@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Parameter a owl:Class .

atm:hasParameter a owl:ObjectProperty ;
    rdfs:domain atm:Initialization ;
    rdfs:range atm:Parameter .

atm:Initialization a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:hasParameter ;
                      owl:allValuesFrom atm:Parameter ] .

atm:k a atm:Parameter .
atm:m a atm:Parameter .
atm:n a atm:Parameter .
atm:t a atm:Parameter .

atm:initializeParameters a owl:NamedIndividual, atm:Initialization ;
    atm:hasParameter atm:k, atm:m, atm:n, atm:t .
